import React from 'react'
import { FaBeer } from "@react-icons/all-files/fa/FaBeer";
const Icons = (props) => {
   
  const icon = <FaBeer />
  return (
    <div>
      <div style={{"--color": props.color}} class="file-icons">{icon}</div>
    </div>
  )
}

export default Icons
